import React, { useEffect, useState } from "react";
import axios from "axios";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

function InvoiceApp() {
  const [order, setOrder] = useState(null);

  useEffect(() => {
    axios.get("http://localhost:3007/orders")
      .then((res) => {
        setOrder(res.data[0]);
      })
      .catch((err) => {
        console.log("Error fetching data", err);
        alert("Error fetching API");
      });
  }, []);

  const generatePDF = () => {
    const doc = new jsPDF();

    doc.setFontSize(20);
    doc.setTextColor(33, 37, 41);
    doc.text("Order Management", 14, 22);
    doc.setFontSize(12);
    doc.setTextColor(100);
    doc.text("Invoice for your order", 14, 30);

    doc.setDrawColor(0, 0, 255);
    doc.line(14, 32, 200, 32);

    doc.setFontSize(12);
    doc.setTextColor(0);
    doc.text("Customer Information:", 14, 42);
    doc.text(`Name: ${order.billTo.name}`, 14, 48);
    doc.text(`Email: ${order.billTo.email}`, 14, 54);
    doc.text(`Address: ${order.billTo.address}`, 14, 60);

    doc.text("Invoice Details:", 120, 42);
    doc.text(`Invoice #: ${order.invoiceNumber}`, 120, 48);
    doc.text(`Date: ${order.date}`, 120, 54);
    doc.text(`Status: ${order.status}`, 120, 60);

    const tableData = order.items.map((item) => [
      item.item,
      `× ${item.quantity}`,
      `$${item.unitPrice.toFixed(2)}`,
      `$${(item.unitPrice * item.quantity).toFixed(2)}`
    ]);

    autoTable(doc, {
      startY: 70,
      head: [["Item", "Quantity", "Unit Price", "Total"]],
      body: tableData,
    });

    const subtotal = order.items.reduce(
      (acc, item) => acc + item.unitPrice * item.quantity,
      0
    );

    const finalY = doc.lastAutoTable.finalY + 10;
    doc.setTextColor(0);
    doc.setFontSize(12);
    doc.text(`Subtotal: $${subtotal.toFixed(2)}`, 150, finalY);
    doc.text(`Tax (0%): $0.00`, 150, finalY + 6);
    doc.setFontSize(14);
    doc.setTextColor(0, 102, 255);
    doc.text(`Total: $${subtotal.toFixed(2)}`, 150, finalY + 15);

    doc.setFontSize(11);
    doc.setTextColor(33, 37, 41);
    doc.text("Thank you for your order!", 14, finalY + 25);

    doc.save("invoice.pdf");
  };

  if (!order) return <div>Loading...</div>;

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h2 style={{ color: "#222" }}>Order Management</h2>
      <div style={{ marginBottom: "20px", border: "1px solid #ddd", padding: "15px", borderRadius: "8px", backgroundColor: "#f9f9f9" }}>
        <h3>Order {order.invoiceNumber}</h3>
        <p><strong>Customer:</strong> {order.billTo.name}</p>
        <p><strong>Email:</strong> {order.billTo.email}</p>
        <p><strong>Date:</strong> {order.date}</p>
        <p><strong>Status:</strong> {order.status}</p>
        <p><strong>Total:</strong> ${order.items.reduce((acc, i) => acc + i.unitPrice * i.quantity, 0).toFixed(2)}</p>
        <button 
          style={{ padding: "10px 20px", backgroundColor: "#007bff", color: "white", border: "none", borderRadius: "5px", cursor: "pointer" }}
          onClick={generatePDF}>
          Generate PDF
        </button>
      </div>
    </div>
  );
}

export default InvoiceApp;
